	public static void main(String[] args) {
		int c=1;
		// TODO Auto-generated method stub
		for(int i=1;i<=5;i++) {
			for(int j=1;j<=5;j++) {
				System.out.print(c+"  ");
				c++;
			}
			System.out.println();
		}

	}

